import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Container from 'react-bootstrap/Container'

import { StudentContext } from "./auth.component";

export default class StudentHome extends Component {
  render () {
    return (
        // TODO: Fix student context
      <Container>
        {/* <StudentContext.Consumer>
          {
            (context) => (
              context.state.isAuthorized
              ? <h1>My email is {context.state.email}</h1>
              : <h1>Oops! Please login first</h1>
            )
          }
        </StudentContext.Consumer> */}
<Tab.Container id="left-tabs-example" defaultActiveKey="first">
      <Row>
        <Col sm={3}>
          <Nav variant="pills" className="flex-column">
            <Nav.Item>
              <Nav.Link eventKey="first">CIS160</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link eventKey="second">MATH240</Nav.Link>
            </Nav.Item>
          </Nav>
        </Col>
        <Col sm={9}>
          <Tab.Content>
            <Tab.Pane eventKey="first">
              <p>CIS160</p>
            </Tab.Pane>
            <Tab.Pane eventKey="second">
              <p>MATH240</p>
            </Tab.Pane>
          </Tab.Content>
        </Col>
      </Row>
    </Tab.Container>
      </Container>
    );
  }
}
